If ((gt2.Lt.1).Or.(gt2.Gt.4)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt2 out of range', gt2 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt2 out of range', gt2 
  Call TerminateProgram 
End If 

If ((gt3.Lt.1).Or.(gt3.Gt.4)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt3 out of range', gt3 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt3 out of range', gt3 
  Call TerminateProgram 
End If 

res = 0._dp 
If ((3.eq.gt3)) Then 
res = res+2*k1*LAM1*UP(gt1,1)*UP(gt2,1)
End If 
If ((3.eq.gt3)) Then 
res = res-8*k1*LAM4*UP(gt1,1)*UP(gt2,1)
End If 
If ((3.eq.gt3)) Then 
res = res+2*k1*LAM5*UP(gt1,1)*UP(gt2,1)
End If 
If ((3.eq.gt3)) Then 
res = res-2*k1*LAM6*UP(gt1,1)*UP(gt2,1)
End If 
If ((4.eq.gt3)) Then 
res = res+ALP1*vR*UP(gt1,1)*UP(gt2,1)
End If 
If ((4.eq.gt3)) Then 
res = res+ALP2*vR*UP(gt1,1)*UP(gt2,1)
End If 
If ((1.eq.gt3)) Then 
res = res-4*k1*LAM3*UP(gt1,3)*UP(gt2,1)
End If 
If ((1.eq.gt3)) Then 
res = res-4*k1*LAM4*UP(gt1,3)*UP(gt2,1)
End If 
If ((1.eq.gt3)) Then 
res = res-2*k1*LAM6*UP(gt1,3)*UP(gt2,1)
End If 
If ((3.eq.gt3)) Then 
res = res+ALP1*k1*UP(gt1,2)*UP(gt2,2)
End If 
If ((3.eq.gt3)) Then 
res = res+ALP3*k1*UP(gt1,2)*UP(gt2,2)
End If 
If ((4.eq.gt3)) Then 
res = res+RHO2*vR*UP(gt1,2)*UP(gt2,2)
End If 
If ((1.eq.gt3)) Then 
