End If 
If ((1.eq.gt3)) Then 
res = res-2*k1*LAM6*UP(gt1,1)*UP(gt2,3)
End If 
If ((3.eq.gt3)) Then 
res = res+2*k1*LAM1*UP(gt1,3)*UP(gt2,3)
End If 
If ((3.eq.gt3)) Then 
res = res+2*k1*LAM2*UP(gt1,3)*UP(gt2,3)
End If 
If ((4.eq.gt3)) Then 
res = res+ALP1*vR*UP(gt1,3)*UP(gt2,3)
